import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import Scanner from './Scanner';
import Logs from './Logs';
import { Container, Row, Col, Nav, Tab, Table } from 'react-bootstrap';
import '../styles/ScannerTabs.css';

const ScannerTabs = () => {
    const { eventId } = useParams();
    const [activeTab, setActiveTab] = useState('scanner');

    return (
        <Container fluid className="mt-3">
            <Tab.Container activeKey={activeTab} onSelect={(key) => setActiveTab(key)}>
                <Row>
                    <Col>
                        <Nav variant="tabs" className="justify-content-center">
                            <Nav.Item>
                                <Nav.Link eventKey="scanner">?? Escaneo</Nav.Link>
                            </Nav.Item>
                            <Nav.Item>
                                <Nav.Link eventKey="logs">?? Ingresos/Egresos</Nav.Link>
                            </Nav.Item>
                        </Nav>
                    </Col>
                </Row>

                <Row className="mt-3">
                    <Col>
                        <Tab.Content>
                            <Tab.Pane eventKey="scanner">
                                <Scanner eventId={eventId} />
                            </Tab.Pane>
                            <Tab.Pane eventKey="logs">
                                <Logs eventId={eventId} />
                            </Tab.Pane>
                        </Tab.Content>
                    </Col>
                </Row>
            </Tab.Container>
        </Container>
    );
};

export default ScannerTabs;
